import React, {Component} from 'react';

import {Grid, Row, Col, Image, Button} from 'react-bootstrap';
import CallToAction from '../../components/CallToAction/CallToAction';

class Website extends Component {

    render() {

        return (
                <div className="Diensten">
                    <Grid>
                        <Row>
                            <Col xs={12}>

                                <h2> Waarom zou je een website nodig hebben voor je onderneming?</h2>
                                <br/>
                                <p>Een website zorgt ervoor dat je altijd online bent vertegenwoordigd </p>
<p>
    Websites heb je in verschillende vormen en maten.
    Een website is jouw eigen stukje virtuele grond en de enige plek op het internet die je volledig onder controle hebt.
    Heb je nog geen website of ben je niet 100% tevreden van je huidige website?
    Dan lossen wij dit graag voor je op.

    Neem even contact op en wij zorgen voor de perfecte afwerking van jouw website.
    Wij werken uitsluitend met WordPress, omdat dit bouwplatform de meeste mogelijkheden biedt en fantastische resultaten oplevert.
    Op deze manier heb je zelf ook de mogelijkheid om achteraf kleine aanpassingen door te voeren zonder technische kennis.</p>

                            </Col>
                        </Row>

                    </Grid>
                    <CallToAction/>
                </div>
        );
    }
}

export default Website;
